import Btn from "./Btn";
import { useState } from "react";

function App() {
  const [value, setValue] = useState(0);
  const cntup = () => {
    setValue((now) => now + 1);
  };
  return (
    <div>
      <h1>Welcome Back!!!!</h1>
      <Btn />
      <button onClick={cntup}>count up</button>
      <h3>{value}</h3>
    </div>
  );
}

export default App;
